import React, { useEffect, useState } from "react";

import axios from "axios";

const WhoAmI = () => {
  const [result, setResult] = useState({
    Response:{ Items: []}, 
  });

  useEffect(() => {
    axios.get("http://127.0.0.1:8000/home/").then((res) => {
      const allPosts = res.data;
      setResult({ Items: allPosts });
      console.log(res.data);
    });
  }, [setResult]);
  return (
    <div>
      { result.Response.Items&&result.Response.Items.map(function (item, index){
        console.log(item);
        return (
          <div key={index}>
            <h2>{item.Href}</h2>
          </div>
        );
      })}
    </div>
  );
};

export default WhoAmI;
